import React from 'react';

import ScheduleCell from '../ScheduleCell/ScheduleCell';

import styles from './SheduleFrame.module.css';


export class ScheduleTable extends React.Component {
  // handleClick () => {console('test1')}

  render() {
    const rows = [];
    for (let i = 0; i < this.props.schedule.length % 7; i++) {
      rows[i] = []
      for (let j = 0; j <  7; j++) {
        rows[i].push(this.props.schedule[i*7+j])
      }
    }

    return (
    	<table className={styles.items}>
        <thead>
          <tr>
            <th>Понедельник</th>
            <th>Вторник</th>
            <th>Среда</th>
            <th>Четверг</th>
            <th>Пятница</th>
            <th>Суббота</th>
            <th>Воскресенье</th>
          </tr>
        </thead>
      <tbody>
        {rows.map(row => <tr>{row.map(col => <td><ScheduleCell cell={col}/></td>)}</tr>)}
      </tbody>
		</table>
    )
  };
}


